import { DealService } from "./deal.service";
import { cloneDeep } from 'lodash-es';
import { ruleOptions } from "./deal.config";
export default {
  name: 'ModalShopFinanceGatheringEarnestDeal',
  bem: {
    sale: 'modal-sold-deal-sale'
  },
  serviceProviders: function serviceProviders() {
    return [DealService];
  },
  serviceInject: function serviceInject() {
    return {
      dealService: DealService
    };
  },
  rxState: function rxState() {
    return {
      loading: this.dealService.loading$,
      list: this.dealService.list$,
      productTypes: this.dealService.productTypes$,
      info: this.dealService.info$
    };
  },
  props: {
    id: {
      type: Number,
      required: true
    }
  },
  data: function data() {
    var form = this.$stForm.create();
    var decorators = form.decorators(ruleOptions);
    return {
      form: form,
      decorators: decorators,
      show: false,
      // 搜索会员
      memberSearchText: '',
      searchMemberIsShow: true
    };
  },
  created: function created() {
    this.dealService.init(this.id).subscribe();
  },
  methods: {
    // 搜索产品
    onProductSearch: function onProductSearch(data) {
      var _this = this;

      this.memberSearchText = data;

      if (data === '') {
        this.dealService.list$.commit(function () {
          return [];
        });
        this.form.resetFields(['product_name']);
      } else {
        var params = {
          product_type: this.form.getFieldValue('product_type'),
          product_name: data
        };
        this.dealService.getList(params).subscribe(function (res) {
          if (!res.list.length) {
            _this.form.resetFields(['product_name']);
          }
        });
      }
    },
    onCancel: function onCancel() {
      this.show = false;
    },
    onNext: function onNext() {
      var _this2 = this;

      this.form.validate().then(function (values) {
        // 到签单页面
        var obj = Object.assign(_this2.info, {
          id: values.product_name,
          product_type: values.product_type
        });

        _this2.$emit('success', obj);

        _this2.show = false;
      });
    }
  }
};
